import{_ as e,o as r,c as t,O as a}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 18.2-150 Willfully destroying vessel, etc.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-150.md","filePath":"vacode/18.2-150.md"}'),o={name:"vacode/18.2-150.md"},l=a('<h1 id="§-18-2-150-willfully-destroying-vessel-etc" tabindex="-1">§ 18.2-150 Willfully destroying vessel, etc. <a class="header-anchor" href="#§-18-2-150-willfully-destroying-vessel-etc" aria-label="Permalink to &quot;§ 18.2-150 Willfully destroying vessel, etc.&quot;">​</a></h1><p>If any person willfully scuttle, cast away or otherwise dispose of, or in any manner destroy, except as otherwise provided, a ship, vessel or other watercraft, with intent to injure or defraud any owner thereof or of any property on board the same, or any insurer of such ship, vessel or other watercraft, or any part thereof, or of any such property on board the same, if the same be of the value of $1,000 or more, he shall be guilty of a Class 4 felony, but if it be of less value than $1,000, he shall be guilty of a Class 1 misdemeanor.</p><p>Code 1950, § 18.1-170; 1960, c. 358; 1975, cc. 14, 15; 1981, c. 197; 2018, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0764" target="_blank" rel="noreferrer">764</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0765" target="_blank" rel="noreferrer">765</a>; 2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0089" target="_blank" rel="noreferrer">89</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0401" target="_blank" rel="noreferrer">401</a>.</p>',3),s=[l];function i(n,c,f,h,d,p){return r(),t("div",null,s)}const u=e(o,[["render",i]]);export{g as __pageData,u as default};
